import React, { useEffect, useState } from 'react';
import { Table, TableHead, TableBody, TableRow, TableCell, TableContainer } from '@material-ui/core'

const App = () => {
  const [data, setData] = useState([])

  useEffect(() => {
    fetch("https://api.rootnet.in/covid19-in/contacts")
      .then(res => res.json())
      .then(res => setData(pre => ({
        ...pre,
        data: res || []
      })))
  }, [])

  useEffect(() => {
    console.log(data.data.contacts.regional[0].loc);
  }, [data]);

  return (
    <>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>State Name</TableCell>
            <TableCell>Helpline Number</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {data.data.contacts.regional.map((row) => (
            <TableRow key={row.loc}>
              <TableCell>{row.number}</TableCell>
            </TableRow>
          ))}

        </TableBody>
      </Table>
    </>
  );

}

export default App;
